import React from "react";

const Library = () => {
  return (
    <>
      <div className=" text-white flex flex-col items-center py-20">
        {/* Icon and Label */}
        <div className="mb-8">
          <div className="flex items-center bg-gray-800 px-4 py-2 rounded-full">
            <span className="material-icons text-white">lock</span>
            <span className="ml-2 text-sm">House of Models Library</span>
          </div>
        </div>

        {/* Title */}
        <h1 className="text-4xl md:text-5xl font-bold text-center mb-4">
          Under the <span className="text-pink-500">hood</span>
        </h1>

        {/* Description */}
        <p className="text-center text-gray-400 max-w-lg px-4">
          Site Builder utilizes a built-in design system and component library
          of 1000+ components made for Figma & Webflow.
        </p>
      </div>
    </>
  );
};

export default Library;
